Alienware M14x R2 Resource DVD (.iso format)

If you're missing drivers, have incorrect drivers, missing Alienware Command Center, or having any other issues with your M14x, you've come to the right place.

ISO contains all drivers and software for your Alienware M14x-R2 Laptop, including network drivers, display drivers, Alienware Command Center, Audio Drivers, Touchpad and webcam drivers, etc. etc.

The resource dvd contained in the ISO is the exact same disc that came with the Alienware laptop. Nothing was modified in anyway.

Disc was converted to .iso format using imgburn.

Tested (mounted with Daemon Tools) and works great.

